import React from 'react'
import { chats } from '../../db'

const ChatsList: React.FC = () => (
  <div>
    <ul>
      {chats.map(chat => {
        console.log(chat)
        return (
          <li key={chat.id}>
            <img src={chat.picture} alt='Profile pic' />
            <div>{chat.name}</div>
            <div>{chat?.lastMessage.content || ''}</div>
          </li>
        )
      })}
    </ul>
  </div>
)

export default ChatsList
